import React from "react";
import DayListItem from "./DayListItem";
import "./DayListItem.scss";

export default function DayList(props) {
  const dayListSection = props.state.days.map(days => (
    <DayListItem
      key={props.state.days.id}
      name={props.state.days.name}
      spots={props.state.days.spots}
      selected={props.state.days.name === props.state.day}
      setDays={props.state.setDays}
    />
  ))
  return(<ul>{dayListSection}</ul>);
};
